import { Link } from "react-router-dom";
const NavBarList = [
    {
        item: 'RESEARCH',
        link: '/research',
    },
    {
        item: 'CV',
        link: '/cv',
    },
    {
        item: 'TEACHING',
        link: '/teaching',
    },
];

function Navbar(): JSX.Element {

    return (
        <nav className="main-nav">
            <ul className="nav-list">
                {NavBarList.map((item) =>
                (
                    <li key={item.item} className="nav-item">
                        <Link to={item.link} className="nav-link">{item.item}</Link>
                    </li>
                )
                )}
            </ul>
        </nav>
    );
}

export default Navbar;
